import React from "react";
import "./Toolbar.css";
const Toolbar = props => (
  <header>
    <nav>
      <div></div>
      <div><a href = "/"> THE LOGO </a></div>
      <div>
        <ul>
          <li><a href = "/"> Products </a></li>
          <li><a href = "/"> Users </a></li>
        </ul>
      </div>
    </nav>
  </header>
);

export default Toolbar;
